/**
 * Traitement: Select a row in LOOP_Produtos
 */
public void selectionLigne()
{
super.selectionLigne();

// 

////////////////////////////////////////////////////////////////////////////
// Déclaration des variables locales au traitement
// (En WLangage les variables sont encore visibles après la fin du bloc dans lequel elles sont déclarées)
////////////////////////////////////////////////////////////////////////////
WDObjet vWD_sSubCat = new WDChaineA();

WDObjet vWD_nvlProduto = new WDNumerique(32, 6);

WDObjet vWD_sTipoTrib = new WDChaineA();

WDObjet vWD_Result1 = new WDEntier4();




try
{
// sSubCat		is string	= ""

vWD_sSubCat.setValeur("");


// nvlProduto	is numeric	= LOOP_Produtos.ATT_Valor

vWD_nvlProduto.setValeur(mWD_ATT_Valor);


// sSubCat		= LOOP_Produtos.ATT_ID
vWD_sSubCat.setValeur(mWD_ATT_ID);

// sTipoTrib is string


// Result1 is int


// Result1 = looperSearch(loop_Itens.att_ID, sSubCat, searchExactMatch)
vWD_Result1.setValeur(WDAPIZoneRepetee.zoneRepeteeCherche(mWD_LOOP_Itens.mWD_ATT_ID,vWD_sSubCat.getString(),1));

// IF Result1 <> -1 THEN				
if(vWD_Result1.opDiff(-1))
{
// 	looperSelectPlus(LOOP_Itens, Result1)
WDAPIZoneRepetee.zoneRepeteeSelectPlus(mWD_LOOP_Itens,new int[] {vWD_Result1.getInt()} );

// 	n		is int		= LOOP_Itens.att_Qtd
WDObjet vWD_n = new WDEntier4();


vWD_n.setValeur(mWD_LOOP_Itens.mWD_ATT_Qtd);


// 	m		is int		= 1 
WDObjet vWD_m = new WDEntier4();


vWD_m.setValeur(1);


// 	z		is int		= n + m 
WDObjet vWD_z = new WDEntier4();


vWD_z.setValeur(vWD_n.opPlus(vWD_m));


// 	nTotal	is numeric	= z * nvlProduto
WDObjet vWD_nTotal = new WDNumerique(32, 6);


vWD_nTotal.setValeur(vWD_z.opMult(vWD_nvlProduto));


// 	TableDelete(LOOP_Itens, Result1)
WDAPITable.tableSupprime(mWD_LOOP_Itens,vWD_Result1.getInt());

// 	IF LOOP_Produtos.ATT_Categoria = "00003" THEN
if(mWD_ATT_Categoria.opEgal(WDContexte.compact("3F9D5E537E2D46E6AAAADBC551690E5336052406CC67C0F045967875963CCCCD"), 0))
{
// 		sTipoTrib = "T"
vWD_sTipoTrib.setValeur("T");

}
else
{
// 		sTipoTrib = "S"	
vWD_sTipoTrib.setValeur("S");

}

// 	TableAddLine(LOOP_Itens,LOOP_Produtos.ATT_Sub,z,nvlProduto,nTotal,sSubCat,1,sTipoTrib)
WDAPITable.tableAjouteLigne(mWD_LOOP_Itens,new Object[] {mWD_ATT_Sub,vWD_z,vWD_nvlProduto,vWD_nTotal,vWD_sSubCat,new WDEntier4(1),vWD_sTipoTrib} );

}
else
{
// 	IF LOOP_Produtos.ATT_Categoria = "00003" THEN
if(mWD_ATT_Categoria.opEgal(WDContexte.compact("8C89788BDA78E168F1750210374322C7524F1D2E6961D04EC2923AA34F686D93"), 0))
{
// 		sTipoTrib = "T"
vWD_sTipoTrib.setValeur("T");

}
else
{
// 		sTipoTrib = "S"	
vWD_sTipoTrib.setValeur("S");

}

// 	TableAddLine(LOOP_Itens,LOOP_Produtos.ATT_Sub,1,nvlProduto,nvlProduto,sSubCat,1,sTipoTrib)
WDAPITable.tableAjouteLigne(mWD_LOOP_Itens,new Object[] {mWD_ATT_Sub,new WDEntier4(1),vWD_nvlProduto,vWD_nvlProduto,vWD_sSubCat,new WDEntier4(1),vWD_sTipoTrib} );

}

// gxTotGeral    = 0
vWD_gxTotGeral.setValeur(0);

// gxTotProdutos = 0
vWD_gxTotProdutos.setValeur(0);

// FOR EACH ROW OF LOOP_Itens
IWDParcours parcours1 = null;
try
{
parcours1 = WDParcoursChamp.pourTout(mWD_LOOP_Itens, 0x2);
while(parcours1.testParcours())
{
//   gxTotProdutos += LOOP_Itens.att_Total		
vWD_gxTotProdutos.opPlusEgal(mWD_LOOP_Itens.mWD_ATT_Total);

}

}
finally
{
if(parcours1 != null)
{
parcours1.finParcours();
}
}


// gxTotGeral = gxTotProdutos + gxTotIngressos
vWD_gxTotGeral.setValeur(vWD_gxTotProdutos.opPlus(vWD_gxTotIngressos));

// STC_Sub_Tot_Produtos = gxTotProdutos
mWD_STC_Sub_Tot_Produtos.setValeur(vWD_gxTotProdutos);

// STC_Geral_Total      = gxTotGeral
mWD_STC_Geral_Total.setValeur(vWD_gxTotGeral);

// LooperSelectMinus(LOOP_Produtos)
WDAPIZoneRepetee.zoneRepeteeSelectMoins(this);

}
catch(WDErreurNonFatale | WDException eCatch)
{
eCatch.catch_GEN();
return;
}
}




