/**
 * Traitement: Click BTN_Proximo
 */
public void clicSurBoutonGauche()
{
super.clicSurBoutonGauche();

// 

////////////////////////////////////////////////////////////////////////////
// Déclaration des variables locales au traitement
// (En WLangage les variables sont encore visibles après la fin du bloc dans lequel elles sont déclarées)
////////////////////////////////////////////////////////////////////////////
WDObjet vWD_xCalcular = new WDNumerique(32, 6);

WDObjet vWD_Result1 = new WDEntier4();




try
{
// xCalcular	is numeric	= 0

vWD_xCalcular.setValeur(0);


// Result1		is int


// Result1 = LooperCount(LOOP_Ingresso)
vWD_Result1.setValeur(WDAPIZoneRepetee.zoneRepeteeOccurrence(mWD_LOOP_Ingresso));

// IF Result1 = 0 THEN
if(vWD_Result1.opEgal(0, 0))
{
// 	Info("Informe o nome do Menor!")
WDAPIDialogue.info(WDContexte.compact("68B8DF51C86B0ADEA3A4C7384D16EC2B7BED6A20E4A1772B07ABCA7C25BF0FBBC99CA6B97D30482638A81B8D49A5A184"));

// 	Return
return;

}
else
{
// 	gnQtdIngresso			= Result1
vWD_gnQtdIngresso.setValeur(vWD_Result1);

// 	FOR EACH ROW OF LOOP_Ingresso
IWDParcours parcours3 = null;
try
{
parcours3 = WDParcoursChamp.pourTout(mWD_LOOP_Ingresso, 0x2);
while(parcours3.testParcours())
{
// 		SWITCH LOOP_Ingresso.ATT_Especial
// Délimiteur de visibilité pour ne pas étendre la visibilité de la variable temporaire _WDExpSelon
{
// 		SWITCH LOOP_Ingresso.ATT_Especial
WDObjet _WDExpSelon0 = mWD_LOOP_Ingresso.mWD_ATT_Especial;
// 		SWITCH LOOP_Ingresso.ATT_Especial
if(_WDExpSelon0.opEgal(WDContexte.compact("CC1944BB24426874CAE1329B6036A152EC60124D17B1DFF804CC3091A44E7181"), 0))
{
// 				xCalcular += gxValorIngresso / 2  
vWD_xCalcular.opPlusEgal(vWD_gxValorIngresso.opDiv(2));

}
// 		SWITCH LOOP_Ingresso.ATT_Especial
else if(_WDExpSelon0.opEgal(WDContexte.compact("D2AED5ECF503C0A9BFA4195B656EB78115E304DF27798A6384DF8D300AB73BBC"), 0))
{
// 				xCalcular += gxValorIngresso  
vWD_xCalcular.opPlusEgal(vWD_gxValorIngresso);

}
// 		SWITCH LOOP_Ingresso.ATT_Especial
else {
}

}

}

}
finally
{
if(parcours3 != null)
{
parcours3.finParcours();
}
}


// 	gxTotIngressos = xCalcular 
vWD_gxTotIngressos.setValeur(vWD_xCalcular);

}

// MyWindow..Plane = 5
WDContexte.getMaFenetre().setProp(EWDPropriete.PROP_PLAN,5);

}
catch(WDErreurNonFatale | WDException eCatch)
{
eCatch.catch_GEN();
return;
}
}




