/**
 * Traitement: Click BTN_Excluir ( LOOP_Itens )
 */
public void clicSurBoutonGauche()
// if TABLE_Itens.COL_ST = "1" THEN
{
super.clicSurBoutonGauche();

// 

try
{
// 	LooperDelete(LOOP_Itens)
WDAPIZoneRepetee.zoneRepeteeSupprime(mWD_LOOP_Itens);

// 	gxTotGeral		= 0
vWD_gxTotGeral.setValeur(0);

// 	gxTotProdutos   = 0
vWD_gxTotProdutos.setValeur(0);

// 	FOR EACH ROW OF LOOP_Itens
IWDParcours parcours4 = null;
try
{
parcours4 = WDParcoursChamp.pourTout(mWD_LOOP_Itens, 0x2);
while(parcours4.testParcours())
{
// 		gxTotProdutos += LOOP_Itens.att_Total			
vWD_gxTotProdutos.opPlusEgal(mWD_ATT_Total);

}

}
finally
{
if(parcours4 != null)
{
parcours4.finParcours();
}
}


//       gxTotGeral				= gxTotProdutos + gxTotIngressos
vWD_gxTotGeral.setValeur(vWD_gxTotProdutos.opPlus(vWD_gxTotIngressos));

//       STC_Sub_Tot_Produtos   	= gxTotProdutos
mWD_STC_Sub_Tot_Produtos.setValeur(vWD_gxTotProdutos);

//       STC_Geral_Total			= gxTotGeral
mWD_STC_Geral_Total.setValeur(vWD_gxTotGeral);

}
catch(WDErreurNonFatale | WDException eCatch)
{
eCatch.catch_GEN();
return;
}
}




