public WDObjet fWD_validaCPF( WDObjet vWD_pCPF )
{
// Procedure ValidaCPF(pCPF is string)
initExecProcLocale("ValidaCPF");



try
{

////////////////////////////////////////////////////////////////////////////
// Déclaration des variables locales au traitement
// (En WLangage les variables sont encore visibles après la fin du bloc dans lequel elles sont déclarées)
////////////////////////////////////////////////////////////////////////////
WDObjet vWD__CPF = new WDChaineA();

WDObjet vWD__Peso = new WDEntier2();

WDObjet vWD__Resto = new WDEntier1();

WDObjet vWD__Digito = new WDEntier1();



vWD_pCPF = WDParametre.traiterParametre(vWD_pCPF, 1, false, 19);



try
{
// _CPF is string


// _Peso	is 2-byte int


// _Resto	is 1-byte int


// _Digito	is 1-byte int


// FOR i=1 _TO_ Length(pCPF)
// Délimiteur de visibilité pour ne pas étendre la visibilité des variables temporaires _WDExpBorneMax et _WDExpPas
{
WDObjet _WDExpBorneMax0 = new WDEntier4(WDAPIChaine.taille(vWD_pCPF));
// FOR i=1 _TO_ Length(pCPF)
for(WDObjet vWD_i = new WDEntier4(1);vWD_i.opInfEgal(_WDExpBorneMax0);vWD_i.opInc())
{
// 	IF 47 < Asc(pCPF[[i]]) < 58 THEN
if(WDAPIChaine.asc(vWD_pCPF.extraireSousElement(vWD_i.getInt())).opDans(new WDEntier4(47),true,new WDEntier4(58),true))
{
// 		_CPF+=pCPF[[i]]
vWD__CPF.opPlusEgal(vWD_pCPF.extraireSousElement(vWD_i.getInt()));

}

}
}

// IF Length(_CPF) <> 11 THEN RESULT False
if(WDAPIChaine.taille(vWD__CPF).opDiff(11))
{
// IF Length(_CPF) <> 11 THEN RESULT False
return new WDBooleen(false);

}

// FOR i=1 TO 10
// FOR i=1 TO 10
for(WDObjet vWD_i = new WDEntier4(1);vWD_i.opInfEgal(10);vWD_i.opInc())
{
// 	_Peso = _Peso + (Asc(_CPF[[1 TO 10]][[i]]) -48)  * (10-i+2)
vWD__Peso.setValeur(vWD__Peso.opPlus(WDAPIChaine.asc(vWD__CPF.extraireSousElement(1,10).extraireSousElement(vWD_i.getInt())).opMoins(48).opMult(new WDEntier4(10).opMoins(vWD_i).opPlus(2))));

}

// _Resto = Modulo(_Peso,11)
vWD__Resto.setValeur(vWD__Peso.opMod(11));

// IF _Resto < 2 THEN
if(vWD__Resto.opInf(2))
{
// 	_Digito = 0
vWD__Digito.setValeur(0);

}
else
{
// 	_Digito = 11 - _Resto
vWD__Digito.setValeur(new WDEntier4(11).opMoins(vWD__Resto));

}

// IF Val(_CPF[[11]]) <> _Digito THEN
if(WDAPIChaine.val(vWD__CPF.extraireSousElement(11)).opDiff(vWD__Digito))
{
// 	RESULT False
return new WDBooleen(false);

}
else
{
// 	RESULT True
return new WDBooleen(true);

}

}
catch(WDErreurNonFatale | WDException eCatch)
{
eCatch.catch_GEN();
return eCatch.getValeurRetour();
}
}
finally
{
finExecProcLocale();

}
}



